import Form from '../components/form';
import Input from '../components/input';
import Radio from '../components/radio';
import Button from '../components/button';

class Home extends React.Component {
  render() {
    return (
      <div className='container'>
        <div className=''>
          <h1>RSVP</h1>
          <Form>
            <Input labelName='First Name' />
            <Input labelName='Last Name' />
            <Radio labelName='Will you be attending?'>
              <Radio.Option value='Yes' inputName='attendance' />
              <Radio.Option value='No' inputName='attendance'/>
            </Radio>
            <Input labelName='Guests' />
            <Button>Submit</Button>
          </Form>
        </div>
        <style jsx global>{`
          body {
            margin: 0;
            padding: 0;
            height: 100vh;
            font-size: 16px;
          }
          .container {
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
          }
          .hide {
            display: none;
          }
        `}</style>
      </div>
    )
  }

}

export default Home
